import React from "react"

function nav(){

    const styles = {
        textDecoration: "none",
        backgroundColor: "grey"
    }

    return (
        <div>
            <ul className = {styles}>
                <li><a href="index.html" >Home</a></li>
                <li><a href="shop.html">Shop</a></li>
                <li><a href="about.html">About</a></li>
            </ul>
            <p>This is a simple paragraph to see if this is working</p>
        </div>
    )
}

export default nav;
